import axios from "axios";
import authHeaders from "./authHeaders";

const API_URL = "http://localhost:8000/api/";

const getUserData = () => {
    return axios.get(API_URL + "profil", authHeaders() );
};

const userService = {
    getUserData,
  };
  export default userService;
